// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract GovToken is ERC20, Ownable {
    mapping(address => bool) public authorizedContracts;

    event Mint(address indexed to, uint256 amount);
    event ContractAuthorized(address indexed contractAddress);
    event ContractRevoked(address indexed contractAddress);

    constructor() ERC20("GovToken", "GVT") Ownable(msg.sender) {}

    function mint(address to, uint256 amount) external onlyOwner {
        require(to != address(0), "GovToken: Minting to zero address is not allowed");
        require(amount > 0, "GovToken: Minting amount must be greater than zero");

        _mint(to, amount);
        emit Mint(to, amount);
    }

    function authorizeContract(address _contract) external onlyOwner {
        require(_contract != address(0), "GovToken: Invalid contract address");
        require(!authorizedContracts[_contract], "GovToken: Contract is already authorized");

        authorizedContracts[_contract] = true;
        emit ContractAuthorized(_contract);
    }

    function revokeContract(address _contract) external onlyOwner {
        require(authorizedContracts[_contract], "GovToken: Contract is not authorized");

        authorizedContracts[_contract] = false;
        emit ContractRevoked(_contract);
    }

    function _update(address from, address to, uint256 amount) internal override {
        require(amount > 0, "GovToken: Transfer amount must be greater than zero");
        if (from != address(0) && to != address(0)) {
            require(authorizedContracts[msg.sender], "GovToken: Transfers restricted to authorized contracts");
        }
        super._update(from, to, amount);
    }
}

